description:
Maria Rya, like an angel who fell from grace, descended down to us to share her unearthly beauty with us. Alright, we don't deny that there is some poetic exaggeration in our opening like, but it is a fact that Maria is a beautiful girl with a nearly perfect body... something that really worth to be marveled.


